import { Fragment } from "react";
import profileImage from "../../assets/images/profile-image.jpg";
import { BsGithub, BsLink45Deg } from "react-icons/bs";
import { AiFillLinkedin } from "react-icons/ai";
import { LoremIpsum } from "react-lorem-ipsum";

import classes from "./Home.module.css";
import MainNavigation from "../MainNavigation/MainNavigation";

const Home = () => {
  return (
    <div className={classes.home} id="home">
      <div className={classes.text}>
        <h1>
          Hello, I'm <span>Barış Can</span>.
        </h1>
        <p>
          a Web Developer <br />
          Located in Antalya, Turkey
        </p>
        <div className={classes.detail}>
          <LoremIpsum
            p={1}
            avgWordsPerSentence={5}
            avgSentencesPerParagraph={5}
          />
        </div>
      </div>
      <MainNavigation />
      {/* <BsChevronDown className={classes.down} /> */}

      <div className={classes["image-and-links"]}>
        <img src={profileImage} alt="me-smiling-with-sunglasses" />
        <div className={classes.links}>
          <a href="https://github.com/bcakko">
            <BsGithub className={classes["link-icon"]} /> Github{" "}
            <BsLink45Deg className={classes["anchor-icon"]} />
          </a>
          <a href="https://www.linkedin.com/in/bar%C4%B1%C5%9F-can-akko%C3%A7ak-96b09697/">
            <AiFillLinkedin className={classes["link-icon"]} /> LinkedIn{" "}
            <BsLink45Deg className={classes["anchor-icon"]} />
          </a>
        </div>
      </div>
    </div>
  );
};

export default Home;
